   - `T` is commonly used as a generic type parameter. It allows you to create reusable components that can work with any data type while still providing type safety.
   - Example:
     ```typescript
     function identity<T>(arg: T): T {
         return arg;
     }

     let output = identity<string>("myString");  // output is of type string
     ```
   - In this example, `T` can be any type, and the function `identity` will return the same type as the input.

